        public static MultiPrecision<Pow2.N16> Value(MultiPrecision<Pow2.N16> lambda) {
            MultiPrecision<Pow2.N16> y = (lambda.Sign == Sign.Plus) ? PositiveValue(lambda) : NegativeValue(lambda);

            return y;
        }

        private static MultiPrecision<Pow2.N16> PositiveValue(MultiPrecision<Pow2.N16> lambda) {
            if (lambda.Sign == Sign.Minus) {
                throw new ArgumentOutOfRangeException(nameof(lambda));
            }

            if (lambda < 2048) {
                MultiPrecision<Pow2.N16> a = APlus(lambda);
                MultiPrecision<Pow2.N16> scale = lambda * lambda + pi2;
                MultiPrecision<Pow2.N16> y = a / scale;

                return y;
            }
            else if (lambda.Exponent <= 516) {
                MultiPrecision<Pow2.N16> invomega = 1 / Omega<Pow2.N16>.Value(lambda);
                MultiPrecision<Pow2.N16> y = ApproxUtil<Pow2.N16>.Poly(invomega, asymptotic_plus) * invomega * invomega;

                return y;
            }
            else {
                return 1 / (lambda * lambda);
            }
        }

